import React, {useState} from 'react';
import Slider from 'react-slick'
import 'slick-carousel/slick/slick.css'
import 'slick-carousel/slick/slick-theme.css'
import { Link  } from 'react-router-dom';

import Left_amthanh from "../../img/left-curved-arrow.png"
import Right_amthanh from "../../img/left-curved.png"

const Sanphamamthanh = () => {
    const Data = [
        {
          id_danhmuc: 1,
          id_tensanpham: '1',
          danhmuc: 'Tai nghe Bluettoth',
        },
        {
          id_danhmuc: 2,
          id_tensanpham: '1',
          danhmuc: 'Tai nghe không dây',
        },
        {
          id_danhmuc: 3,
          id_tensanpham: '1',
          danhmuc: 'Tai nghe Gaming',
        },
        {
          id_danhmuc: 4,
          id_tensanpham: '1',
          danhmuc: 'Tai nghe chụp tai',
        },
        {
          id_danhmuc: 5,
          id_tensanpham: '1',
          danhmuc: 'Loa Karaoke',
        },
        {
          id_danhmuc: 6,
          id_tensanpham: '1',
          danhmuc: 'Loa Soundbar',
        }
      ]

        const SlickArrowLeftamthanh = ({ currentSlide, slideCount, ...props }) => (
        <img src={Left_amthanh} alt="prevArrow" {...props} className="SlickArrowLeft_amthanh"/>
      );

      const SlickArrowRightamthanh = ({ currentSlide, slideCount, ...props }) => (
        <img src={Right_amthanh} alt="nextArrow" {...props} className="SlickArrowRight_amthanh"/>
      );
        const sliderSettings_amthanh =  {
          initialSlide: 0,
          autoplay: true,
          centerMode: false,
          swipeToSlide: true,
          pauseOnDotsHover: true,
          arrows: true,
          rows: 1,
          draggable: true,
          slidesToShow: 5,
          shift: 10,
          dots: false,
          infinite: true,
          wheel: true,
          speed: 500,
          prevArrow: <SlickArrowLeftamthanh />,
        nextArrow: <SlickArrowRightamthanh />,
        };

  return (
    <div>

    </div>
  )
}

export default Sanphamamthanh
